column8:
歴史が輝く、トータル内面美容ドリンク<br><br>

天然のフィッシュコラーゲンのほか選び抜いた注目の素材をバランスよく配合。<br>
美しさの再生力を高め、輝きをサポートします。<br><br>

≪おすすめしたい方≫<br>
・キレイのためのベースケアに<br>
・からだの中からしっかりと栄養補給したい方に<br>
・毎日の美容のサポートに<br><br>

≪お召し上がり方≫<br>
1日25mLを目安に冷蔵庫で冷やしてお飲みください。<br>
開栓後は冷蔵庫に保管し、1ヶ月以内にお召し上がりください。<br>
天然物を使用しておりますので、製造ロットによって若干味、色の違いや沈殿物を生じる場合がありますが、品質には問題ありません。<br><br>

【原材料】<br>
フィッシュコラーゲンペプチド(ゼラチン由来)、還元麦芽糖水飴、食物繊維、乳糖果糖オリゴ糖、高圧搾りんご果液、高果糖液糖、大豆ペプチド、セラミド含有コーン抽出物、小麦たん白加水分解物、酵母エキス、L-オルニチン、L-シトルリン、サケ鼻軟骨抽出物(プロテオグリカン含有)、ハス胚芽エキス、紫菊花エキス/酸味料、ビタミンC、香料、カラメル色素、甘味料(アセスルファムK、スクラロース)、保存料(安息香酸Na)、ビオチン、ヒアルロン酸、ビタミンB2、ビタミンB1、ビタミンB6、葉酸<br>
【栄養成分】25mLあたり<br>
エネルギー 33.3kcal、たんぱく質 6.1g、脂質 0g、炭水化物 2.2g、食塩相当量 0.025g、ビオチン 45μg、フィッシュコラーゲン 5,500mg、大豆ペプチド 100mg、小麦たん白加水分解物 50mg、ハス胚芽エキス 20mg、紫菊花エキス 10mg、ヒアルロン酸 5mg、プロテオグリカン 5mg、セラミド 600?<br><br>

※1日当たりの栄養素等表示基準値に占める割合<br>
(25mLあたり):ビオチン 100%<br>

